import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './MyComponents/Navbar';
import Home from './MyComponents/Home'; // Import the Home component
import Nova from './MyComponents/Nova'; // Import the Nova component
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          exact
          path="/"
          element={
            <>
              <Home />
              <Nova />
            </>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
